	const tapeImages = document.getElementsByClassName(
		"QuestionNote-maskingTape-img"
	);
	console.log(tapeImages);

	return (
		<>
			<div className="question-notes-container">
				{props.questionList.map((question, idx) => (
					<React.Fragment>
